(3, 'نحن في تطبيق الكوثر نحترم خصوصية مستخدمينا  ونلتزم بحماية بياناتهم الشخصية. توضح هذه السياسة كيفية جمع معلوماتك الشخصية واستخدامها وحمايتها عند استخدامك للتطبيق.\r\n\r\n1. جمع المعلومات\r\n\r\nقد نقوم بجمع بعض المعلومات الشخصية مثل:\r\n\r\nالاسم، البريد الإلكتروني، رقم الهاتف، وعنوانك.\r\n\r\nمعلومات الاستخدام مثل نوع الجهاز ونظام التشغيل وسجل النشاط داخل التطبيق.\r\n\r\nموقعك الجغرافي (في حال استخدام ميزات تعتمد على تحديد الموقع)', 'At El Kawther, we value your privacy and are committed to protecting your personal data. This Privacy Policy explains how we collect, use, and safeguard your information when you use our application and services.\r\n\r\n1. Information We Collect\r\n\r\nWe may collect the following types of data:\r\n\r\nPersonal details such as your name, phone number, email address, and location.\r\n\r\nUsage data including device type, operating system, and activity logs within the app.\r\n\r\nLocation information, if you enable location-based features.', '📜 الشروط والأحكام الخاصة بتطبيق الكوثر\r\n\r\nمرحبًا بك في تطبيق الكوثر.\r\nباستخدامك للتطبيق، فإنك توافق على الالتزام بالشروط والأحكام التالية. يرجى قراءة هذه الشروط بعناية قبل استخدام التطبيق.\r\n\r\n1. الموافقة على الشروط\r\n\r\nيُعد استخدامك للتطبيق موافقة صريحة على هذه الشروط والأحكام، وعلى سياسة الخصوصية الخاصة بنا.\r\nإذا كنت لا توافق على أي من هذه الشروط، يُرجى عدم استخدام التطبيق.', 'Welcome to El Kawther Application.\r\nBy using this app, you agree to comply with and be bound by the following terms and conditions. Please read them carefully before using the application.\r\n\r\n1. Acceptance of Terms\r\n\r\nBy accessing or using El Kawther Application, you acknowledge that you have read, understood, and agreed to these Terms and Conditions and our Privacy Policy.\r\nIf you do not agree, please refrain from using the app.', 'https://www.facebook.com/', 'https://www.facebook.com/', 'https://www.facebook.com/', 'https://www.facebook.com/', '+964 774 114 4423', 'https://goo.gl/maps/Xk3Qx8GZHQZ2', '100', '10', 7822556410, 30, '2025-07-06 21:43:31', '2025-10-19 15:00:30');
